import "./index.css";
import React from "react";
const img1 ="https://source.unsplash.com/weekly?water";
const img2 ="https://source.unsplash.com/weekly?water";
const img3 ="https://source.unsplash.com/weekly?water";
const img4 ="https://source.unsplash.com/weekly?water";
const img5 ="https://source.unsplash.com/weekly?water";
const link = "https://www.msn.com/en-in/news/other/as-centre-aims-to-ramp-up-covid-19-testing-focus-on-rapid-antigen-tests/ar-AAKdpGs?ocid=msedgntp";
let cssstyle = {
   color:'blue',
};
let css2style = {
    Width:'200px',
    Height:'200px'
}
function Design(){
    return(<>
    <div class="card">
        <h1 style = {cssstyle}>Top 5 Netflix series</h1>
        <div class="card1">
            
        </div>
        <div class="card1">
            <img style = {css2style} src={img1} alt="card1"/>
        <div>
            <a href={link}><button>Start Now</button></a></div>
        </div>
        <div class="card2">
            <img src={img2} alt="card1"/><div>
            <a href={link}><button>Start Now</button></a>
        </div>
        </div>
        <div class="card3">
            <img src={img3} alt="card1" />
            <div>
            <a href={link}><button>Start Now</button></a></div>
        </div>
        <div class="card4">
            <img src={img4} alt="card1" />
            <div>
            <a href={link}><button>Start Now</button></a></div>
        </div>
        <div class="card5">
            <  img src={img5} alt="card1" />
            <div>
            <a href={link}><button>Start Now</button></a></div>
        </div>
    </div>

    </>);
}
export default Design;
